import axios from "axios";
import { AllMovies } from "../Types/movieTypes"

export const getAllMovies = () => {
    const responsive = axios.get('https://api.themoviedb.org/3/movie/popular?api_key=0d4cbfe47f14bc16cfefd10fa3dfc816&language=ar');
    return {type : AllMovies , data : [], pages :0}
}
